class CelticCross extends React.Component {
    constructor(props) {
      super(props);
      this.state = {date: new Date()};
    }

    componentDidMount() {
        const res = getRandomCards();
        console.log(res);

        return {
          cards: res
        };
    }

    render() {
      return (
        <div>
        here is a gameboard +.
         </div>
      );
    }
  }
